import { blue } from "@mui/material/colors";
import React from "react";
// import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Successcard3=()=>{
    return(
        <React.Fragment>
            <div class="container">
  <div className="row">
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/39005/14/780114219-1688320380.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Krishil Soni weds Dipikaben Mistry</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>I met Krishil Soni through Jeevansathi last year on 22 April 2022. It started as an arranged marriage and ended up being a love marriage. Liked him at the first instance and we began a lifelong journey of love and togetherness. It is like a dream come true for both of us. To all the single people out there, we would advise you to keep things simple and real. Good luck with finding the right partner like I did. Thanks, Jeevansathi for helping me find my soulmate.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/38899/7/777987963-1687980222.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Gaurav Pandey weds Monal Mishra</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>Hi, I would like to thank Jeevansathi for their efforts and their profile matching for my Current partner. It all started on December 2021, where my Dad has sent request to Mr.Gaurav Pandey as he had liked his profile and wanted to have further conversation. As Mr.Pandey has accepted the request, My father had called him and they kept on talking for continuous 2hrs. I would like to appreciate Jeevansathi for giving us an opportunity and a platform to connect so that we can share our lives together.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/37964/1/759281645-1684673831.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Manu Prakash weds Pritee Suman</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>We met in 2020 October after 2 years exhaustive search for partner. I was there on Jeevansathi for two years and for once it felt that I would never find the kind of partner I am looking for. And boom, he just appeared. My cousin sister(Priyanka) use to handle my account. She connected with him and in no time we understood that this is it. His profile was simple not all drama about exaggerating about himself. That made me curious to get to know him more.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
  </div>
</div>
        </React.Fragment>
    )
}
export default Successcard3;
